import React, { useState, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { useParams } from "react-router-dom";
import { getEmployee, createEmployee } from "../../actions/EmployeeActions";

const UpdateEmployee = () => {
  const { dep_id } = useParams();
  const { id } = useParams();
  const dispatch = useDispatch();
  const errors = useSelector((state) => state.errorsReducerContent);
  const employee = useSelector((state) => state.employeeReducerContent.employee);

  const [state, setState] = useState({
    id: "",
    name: "",
    address: "",
    email: "",
    phone: "",
    departmentBacklog: "",
    errors: {},
  });

  useEffect(() => {
    dispatch(getEmployee(dep_id, id));
  }, [dispatch, dep_id, id]);

  useEffect(() => {
    setState((prevState) => ({
      ...prevState,
      id: id,
      name: employee.name || "",
      address: employee.address || "",
      email: employee.email || "",
      phone: employee.phone || "",
      errors: errors,
    }));
  }, [employee, id, errors]);

  const onChange = (e) => {
    setState((prevState) => ({
      ...prevState,
      [e.target.name]: e.target.value,
    }));
  };

  const onSubmit = (e) => {
    e.preventDefault();
    const updateEmployee = {
      id: state.id,
      name: state.name,
      address: state.address,
      email: state.email,
      phone: state.phone,
    };
    dispatch(createEmployee(updateEmployee, dep_id));
  };

  return (
    <div>
    <div className="employee">
      <div className="container">
        <div className="row">
          <div className="col-md-8 m-auto">
            <h5 className="text-4xl text-center">Update Employee Form</h5>
            <hr className="my-4" />
            <div className="form-group">
              <input
                type="text"
                className="form-input form-input-lg"
                placeholder="ID"
                name="id"
                disabled
                value={state.id}
                onChange={onChange}
              />
            </div>
            <form onSubmit={onSubmit} className="space-y-4 mx-auto lg:mx-0 mr-4">
              <div className="form-group">
                <input
                  type="text"
                  className={`w-full p-3 border rounded-lg ${
                    errors.name ? "border-red-500" : ""
                  }`}
                  placeholder="Employee Name"
                  value={state.name}
                  onChange={onChange}
                  name="name"
                />
                {errors.name && (
                  <div className="text-red-500">{errors.name}</div>
                )}
              </div>
              <div className="form-group">
                <input
                  type="text"
                  className={`w-full p-3 border rounded-lg ${
                    errors.address ? "border-red-500" : ""
                  }`}
                  placeholder="Employee Address"
                  name="address"
                  value={state.address}
                  onChange={onChange}
                />
                {errors.address && (
                  <div className="text-red-500">{errors.address}</div>
                )}
              </div>
              <div className="form-group">
                <input
                  type="text"
                  className={`w-full p-3 border rounded-lg ${
                    errors.email ? "border-red-500" : ""
                  }`}
                  placeholder="Employee Email"
                  name="email"
                  value={state.email}
                  onChange={onChange}
                />
                {errors.email && (
                  <div className="text-red-500">{errors.email}</div>
                )}
              </div>
              <div className="form-group">
                <input
                  type="text"
                  className={`w-full p-3 border rounded-lg ${
                    errors.phone ? "border-red-500" : ""
                  }`}
                  placeholder="Phone Number"
                  name="phone"
                  value={state.phone}
                  onChange={onChange}
                />
                {errors.phone && (
                  <div className="text-red-500">{errors.phone}</div>
                )}
              </div>
  
              <button type="submit" className="bg-blue-500 text-white font-bold py-2 px-4 rounded-lg w-full">
                Update Employee
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  </div>
  );
};

export default UpdateEmployee;
